INSERT INTO `lyrics` VALUES (1,1,'\r\n\r\nOnce upon a time, you dressed so fine\r\nYou threw the bums a dime in your prime, didn\'t you?\r\nPeople\'d call, say, \"Beware doll, you\'re bound to fall\"\r\nYou thought they were all kiddin\' you\r\n\r\nYou used to laugh about\r\nEverybody that was hangin\' out\r\nNow you don\'t talk so loud, now you don\'t seem so proud\r\nAbout havin\' to be scrounging your next meal\r\n\r\nHow does it feel, how does it feel?\r\nTo be without a home\r\nLike a complete unknown\r\nLike a rolling stone?\r\n\r\nYou\'ve gone to the finest school all right, Miss Lonely\r\nBut you know you only used to get juiced in it\r\nAnd nobody has ever taught you how to live out on the street\r\nAnd now you find out you\'re gonna have to get used to it\r\n\r\nYou said you\'d never compromise\r\nWith the mystery tramp, but now you realize\r\nHe\'s not selling any alibis, as you stare into the vacuum of his eyes\r\nAnd say, \" Do you want to make a deal?\"\r\n\r\nHow does it feel, how does it feel?\r\nTo be on your own\r\nWith no direction home, like a complete unknown\r\nLike a rolling stone?\r\n\r\nYou never turned around to see the frowns\r\nOn the jugglers and the clowns\r\nWhen they all come down and do tricks for you\r\nYou never understood that it ain\'t no good\r\nYou shouldn\'t let other people get your kicks for you\r\n\r\nUsed to ride on the chrome horse with your diplomat\r\nWho carried on his shoulder a Siamese cat\r\nAin\'t it hard when you discover that\r\nHe really wasn\'t where it\'s at\r\nAfter he took from you everything he could steal\r\n\r\nHow does it feel, how does it feel?\r\nTo be on your own\r\nWith no direction home, like a complete unknown\r\nLike a rolling stone?\r\n\r\nPrincess on the steeple and all the pretty people\r\nThey\'re all drinkin\', thinkin\' that they got it made\r\nExchanging all kinds of precious gifts and things\r\nBut you\'d better lift your diamond ring, you\'d better pawn it, babe\r\n\r\nYou used to be so amused\r\nAt Napoleon in rags and the language that he used\r\nGo to him now, he calls you, you can\'t refuse\r\nWhen you got nothing, you got nothing to lose\r\nYou\'re invisible now, you got no secrets to conceal\r\n\r\nHow does it feel, how does it feel?\r\nTo be on your own\r\nWith no direction home, like a complete unknown\r\nLike a rolling stone\r\n\r\n','2014-10-31 15:01:51','2014-10-31 15:01:51'),(2,2,'\r\n\r\nI can\'t get no satisfaction\r\nI can\'t get no satisfaction\r\n\'Cause I try and I try and I try and I try\r\nI can\'t get no, I can\'t get no\r\n\r\nWhen I\'m drivin\' in my car\r\nAnd the man comes on the radio\r\nHe\'s tellin\' me more and more\r\nAbout some useless information\r\nSupposed to drive my imagination\r\n\r\nI can\'t get no, oh no, no, no\r\nHey, hey, hey, that\'s what I say\r\n\r\nI can\'t get no satisfaction\r\nI can\'t get no satisfaction\r\n\'Cause I try and I try and I try and I try\r\nI can\'t get no, I can\'t get no\r\n\r\nWhen I\'m watchin\' my TV\r\nAnd a man comes on and tells me\r\nHow white my shirts can be\r\nBut he can\'t be a man \'cause he doesn\'t smoke\r\nThe same cigarettes as me\r\n\r\nI can\'t get no, oh no, no, no\r\nA hey, hey, hey, that\'s what I say\r\n\r\nI can\'t get no satisfaction\r\nI can\'t get no girl reaction\r\n\'Cause I try and I try and I try and I try\r\nI can\'t get no, I can\'t get no\r\n\r\nWhen I\'m ridin\' round the world\r\nAnd I\'m doin\' this and I\'m signing that\r\nAnd I\'m tryin\' to make some girl\r\nWho tells me baby better come back, maybe next week\r\n\'Cause you see I\'m on losing streak\r\n\r\nI can\'t get no, oh no, no, no\r\nA hey, hey, hey, that\'s what I say\r\n\r\nI can\'t get no, I can\'t get no\r\nI can\'t get no satisfaction, no satisfaction\r\nNo satisfaction, no satisfaction\r\nI can\'t get no\r\n\r\n','2014-10-31 16:23:40','2014-10-31 16:23:40'),(3,5,'\r\n\r\nImagine there\'s no heaven\r\nIt\'s easy if you try\r\nNo hell below us\r\nAbove us only sky\r\n\r\nImagine all the 