 me\r\nIn the jingle jangle morning, I\'ll come followin\' you\r\n\r\nThen take me disappearin\' through the smoke rings of my mind\r\nDown the foggy ruins of time, far past the frozen leaves\r\nThe haunted, frightened trees, out to the windy beach\r\nFar from the twisted reach of crazy sorrow\r\n\r\nYes, to dance beneath the diamond sky with one hand waving free\r\nSilhouetted by the sea, circled by the circus sands\r\nWith all memory and fate driven deep beneath the waves\r\nLet me forget about today until tomorrow\r\n\r\nHey, Mr. Tambourine Man, play a song for me\r\nI\'m not sleepy and there is no place I\'m going to\r\nHey, Mr. Tambourine Man, play a song for me\r\nIn the jingle jangle morning, I\'ll come followin\' you\r\n\r\n','2014-12-05 07:18:44','2014-12-05 07:18:44'),(113,170,'So, so you think you can tell\r\nHeaven from Hell,\r\nBlue sky\'s from pain.\r\nCan you tell a green field\r\nFrom a cold steel rail?\r\nA smile from a veil?\r\nDo you think you can tell?\r\n\r\nAnd did they get you to trade\r\nYour heroes for ghosts?\r\nHot ashes for trees?\r\nHot air for a cool breeze?\r\nCold comfort for change?\r\nAnd did you exchange\r\nA walk on part in the war\r\nFor a lead role in a cage?\r\n\r\nHow I wish, how I wish you were here.\r\nWe\'re just two lost souls\r\nSwimming in a fish bowl,\r\nYear after year,\r\nRunning over the same old ground.\r\nAnd how we found\r\nThe same old fears.\r\nWish you were here.\r\n','2015-03-24 08:09:19','2015-03-24 08:14:01'),(110,110,'\r\n\r\nI\'m a-gonna tell you how it\'s gonna be\r\nyou\'re gonna give your love to me\r\nI wanna love you night and day\r\nyou know my love a-not fade away\r\na-well, you know my love a-not fade away\r\n\r\nMy love a-bigger than a cadillac\r\nI try to show it and you drive a-me back\r\nyour love for me a-got to be real\r\nfor you to know just how I feel\r\na love for real not fade away\r\n\r\nI\'m a-gonna tell you how it\'s gonna be\r\nyou\'re gonna give your love to me\r\na love to last a-mo